using System;
using System.Data;
using System.Windows.Forms;

namespace sess4try3 {
    public partial class Form1 : Form {
        public Form1() {
            InitializeComponent();
        }

        private void Form1_Load(object sender, EventArgs e) {
            // TODO: –¥–∞–Ω–Ω–∞—è —Å—Ç—Ä–æ–∫–∞ –∫–æ–¥–∞ –ø–æ–∑–≤–æ–ª—è–µ—Ç –∑–∞–≥—Ä—É–∑–∏—Ç—å –¥–∞–Ω–Ω—ã–µ –≤ —Ç–∞–±–ª–∏—Ü—É "doctorsAppDataSet.schedule". –ü—Ä–∏ –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ—Å—Ç–∏ –æ–Ω–∞ –º–æ–∂–µ—Ç –±—ã—Ç—å –ø–µ—Ä–µ–º–µ—â–µ–Ω–∞ –∏–ª–∏ —É–¥–∞–ª–µ–Ω–∞.
            this.scheduleTableAdapter.Fill(this.doctorsAppDataSet.schedule);

        }

        private void save_Click(object sender, EventArgs e) {
            this.scheduleTableAdapter.Update(this.doctorsAppDataSet.schedule);
        }

        private void FilterToday_Click(object sender, EventArgs e) {
            DataView view = new DataView(doctorsAppDataSet.schedule);
            view.RowFilter = $"date = '{DateTime.Today.ToString("yyyy-MM-dd")}'";
            table.DataSource = view;
        }

        private void FilterWeek_Click(object sender, EventArgs e) {
            DataView view = new DataView(doctorsAppDataSet.schedule);
            view.RowFilter = $"date >= '{DateTime.Today.ToString("yyyy-MM-dd")}' AND date < '{DateTime.Today.AddDays(7).ToString("yyyy-MM-dd")}'";
            table.DataSource = view;
        }

        private void FilterMonth_Click(object sender, EventArgs e) {
            DataView view = new DataView(doctorsAppDataSet.schedule);
            view.RowFilter = $"date >= '{DateTime.Today.ToString("yyyy-MM-dd")}' AND date < '{DateTime.Today.AddMonths(1).ToString("yyyy-MM-dd")}'";
            table.DataSource = view;
        }

        private void FilterReset_Click(object sender, EventArgs e) {
            table.DataSource = new DataView(doctorsAppDataSet.schedule);
        }
    }
}

import java.util.Scanner; // –ò–º–ø–æ—Ä—Ç–∏—Ä—É–µ—Ç –∫–ª–∞—Å—Å Scanner –¥–ª—è —Å—á–∏—Ç—ã–≤–∞–Ω–∏—è –¥–∞–Ω–Ω—ã—Ö —Å –∫–ª–∞–≤–∏–∞—Ç—É—Ä—ã
import java.util.Hashtable; // –ò–º–ø–æ—Ä—Ç–∏—Ä—É–µ—Ç –∫–ª–∞—Å—Å–∞ Hashtable –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –¥–∞–Ω–Ω—ã—Ö –≤ —Ñ–æ—Ä–º–∞—Ç–µ –∫–ª—é—á-–∑–Ω–∞—á–µ–Ω–∏–µ

public class var8 { // –û–±—ä—è–≤–ª—è–µ—Ç –ø—É–±–ª–∏—á–Ω—ã–π –∫–ª–∞—Å—Å var8
    public static void main(String[] args) { // –û–±—ä—è–≤–ª—è–µ—Ç –≥–ª–∞–≤–Ω—ã–π –º–µ—Ç–æ–¥ main
        Scanner sc = new Scanner(System.in); // –°–æ–∑–¥–∞–µ—Ç –æ–±—ä–µ–∫—Ç Scanner –¥–ª—è —Å—á–∏—Ç—ã–≤–∞–Ω–∏—è –¥–∞–Ω–Ω—ã—Ö —Å –∫–ª–∞–≤–∏–∞—Ç—É—Ä—ã
        var8 obj = new var8(); // –°–æ–∑–¥–∞–µ—Ç –æ–±—ä–µ–∫—Ç –∫–ª–∞—Å—Å–∞ var8
        Hashtable<String, Method> methods = new Hashtable<>(); // –°–æ–∑–¥–∞–µ—Ç —Ö–µ—à-—Ç–∞–±–ª–∏—Ü—É –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –º–µ—Ç–æ–¥–æ–≤ –∑–∞–ø—Ä–æ—Å–æ–≤
        methods.put("POST", obj.new Method("POST", "–ú–µ—Ç–æ–¥ POST –∏—Å–ø–æ–ª—å–∑—É–µ—Ç—Å—è –¥–ª—è –æ—Ç–ø—Ä–∞–≤–∫–∏ –¥–∞–Ω–Ω—ã—Ö –Ω–∞ —Å–µ—Ä–≤–µ—Ä.")); // –î–æ–±–∞–≤–ª—è–µ—Ç –º–µ—Ç–æ–¥ POST –≤ —Ö–µ—à-—Ç–∞–±–ª–∏—Ü—É
        methods.put("GET", obj.new Method("GET", "–ú–µ—Ç–æ–¥ GET –∏—Å–ø–æ–ª—å–∑—É–µ—Ç—Å—è –¥–ª—è –ø–æ–ª—É—á–µ–Ω–∏—è –¥–∞–Ω–Ω—ã—Ö —Å —Å–µ—Ä–≤–µ—Ä–∞.")); // –î–æ–±–∞–≤–ª—è–µ—Ç –º–µ—Ç–æ–¥ GET –≤ —Ö–µ—à-—Ç–∞–±–ª–∏—Ü—É

        Hashtable<Integer, StatusCode> statuses = new Hashtable<>(); // –°–æ–∑–¥–∞–µ—Ç —Ö–µ—à-—Ç–∞–±–ª–∏—Ü—É –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –∫–æ–¥–æ–≤ —Å–æ—Å—Ç–æ—è–Ω–∏—è
        statuses.put(200, obj.new StatusCode(200, "OK. –ó–∞–ø—Ä–æ—Å —É—Å–ø–µ—à–Ω–æ –æ–±—Ä–∞–±–æ—Ç–∞–Ω —Å–µ—Ä–≤–µ—Ä–æ–º –∏ –æ—Ç–≤–µ—Ç —Å–æ–¥–µ—Ä–∂–∏—Ç –∑–∞–ø—Ä–∞—à–∏–≤–∞–µ–º—ã–π —Ä–µ—Å—É—Ä—Å.")); // –î–æ–±–∞–≤–ª—è–µ—Ç –∫–æ–¥ —Å–æ—Å—Ç–æ—è–Ω–∏—è 200 –≤ —Ö–µ—à-—Ç–∞–±–ª–∏—Ü—É
        statuses.put(400, obj.new StatusCode(400, "Bad Request. –°–µ—Ä–≤–µ—Ä –Ω–µ –º–æ–∂–µ—Ç –æ–±—Ä–∞–±–æ—Ç–∞—Ç—å –∑–∞–ø—Ä–æ—Å –∏–∑-–∑–∞ –Ω–µ–≤–µ—Ä–Ω–æ–≥–æ —Å–∏–Ω—Ç–∞–∫—Å–∏—Å–∞ –∏–ª–∏ –Ω–µ–¥–æ–ø—É—Å—Ç–∏–º—ã—Ö –ø–∞—Ä–∞–º–µ—Ç—Ä–æ–≤.")); // –î–æ–±–∞–≤–ª—è–µ—Ç –∫–æ–¥ —Å–æ—Å—Ç–æ—è–Ω–∏—è 400 –≤ —Ö–µ—à-—Ç–∞–±–ª–∏—Ü—É
        statuses.put(404, obj.new StatusCode(404, "Not Found. –°–µ—Ä–≤–µ—Ä –Ω–µ –º–æ–∂–µ—Ç –Ω–∞–π—Ç–∏ –∑–∞–ø—Ä–∞—à–∏–≤–∞–µ–º—ã–π —Ä–µ—Å—É—Ä—Å.")); // –î–æ–±–∞–≤–ª—è–µ—Ç –∫–æ–¥ —Å–æ—Å—Ç–æ—è–Ω–∏—è 404 –≤ —Ö–µ—à-—Ç–∞–±–ª–∏—Ü—É
        statuses.put(500, obj.new StatusCode(500, "Internal Server Error. –ü—Ä–æ–∏–∑–æ—à–ª–∞ –≤–Ω—É—Ç—Ä–µ–Ω–Ω—è—è –æ—à–∏–±–∫–∞ —Å–µ—Ä–≤–µ—Ä–∞.")); // –î–æ–±–∞–≤–ª—è–µ—Ç –∫–æ–¥ —Å–æ—Å—Ç–æ—è–Ω–∏—è 500 –≤ —Ö–µ—à-—Ç–∞–±–ª–∏—Ü—É

        boolean exit = false; // –û–±—ä—è–≤–ª—è–µ—Ç –ø–µ—Ä–µ–º–µ–Ω–Ω—É—é exit –¥–ª—è –æ—Ç—Å–ª–µ–∂–∏–≤–∞–Ω–∏—è –≤—ã—Ö–æ–¥–∞ –∏–∑ —Ü–∏–∫–ª–∞
        while (!exit) { // –ù–∞—á–∏–Ω–∞–µ—Ç —Ü–∏–∫–ª while, –ø–æ–∫–∞ exit –Ω–µ —Ä–∞–≤–µ–Ω true
            System.out.print("1. –ê–Ω–∞–ª–∏–∑ IP-–∞–¥—Ä–µ—Å–∞\n2. –ê–Ω–∞–ª–∏–∑ –º–µ—Ç–æ–¥–æ–≤ –∑–∞–ø—Ä–æ—Å–æ–≤\n3. –ê–Ω–∞–ª–∏–∑ –∫–æ–¥–∞ —Å–æ—Å—Ç–æ—è–Ω–∏—è\n0. –í—ã—Ö–æ–¥ \n–í–∞—à –≤—ã–±–æ—Ä: "); // –í—ã–≤–æ–¥–∏—Ç –º–µ–Ω—é –≤—ã–±–æ—Ä–∞ –æ–ø–µ—Ä–∞—Ü–∏–∏
            String operation = sc.nextLine(); // –°—á–∏—Ç—ã–≤–∞–µ—Ç –≤—ã–±—Ä–∞–Ω–Ω—É—é –æ–ø–µ—Ä–∞—Ü–∏—é —Å –∫–ª–∞–≤–∏–∞—Ç—É—Ä—ã

            switch (operation) { // –ù–∞—á–∏–Ω–∞–µ—Ç –±–ª–æ–∫ switch-case –¥–ª—è –≤—ã–±–æ—Ä–∞ –æ–ø–µ—Ä–∞—Ü–∏–∏
                case "1":
                    System.out.println("–í–≤–µ–¥–∏—Ç–µ IP-–∞–¥—Ä–µ—Å: "); // –í—ã–≤–æ–¥–∏—Ç –ø—Ä–∏–≥–ª–∞—à–µ–Ω–∏–µ –≤–≤–æ–¥–∞ IP-–∞–¥—Ä–µ—Å–∞
                    String ipAddress = sc.nextLine(); // –°—á–∏—Ç—ã–≤–∞–µ—Ç IP-–∞–¥—Ä–µ—Å —Å –∫–ª–∞–≤–∏–∞—Ç—É—Ä—ã
                    if (obj.validateIP(ipAddress)) { // –ü—Ä–æ–≤–µ—Ä—è–µ—Ç –∫–æ—Ä—Ä–µ–∫—Ç–Ω–æ—Å—Ç—å IP-–∞–¥—Ä–µ—Å–∞
                        System.out.println("IP-–∞–¥—Ä–µ—Å –≤–≤–µ–¥–µ–Ω –≤–µ—Ä–Ω–æ."); // –í—ã–≤–æ–¥–∏—Ç —Å–æ–æ–±—â–µ–Ω–∏–µ –æ–± —É—Å–ø–µ—à–Ω–æ–π –ø—Ä–æ–≤–µ—Ä–∫–µ
                    } else {
                        System.out.println("IP-–∞–¥—Ä–µ—Å –≤–≤–µ–¥–µ–Ω –Ω–µ–≤–µ—Ä–Ω–æ."); // –í—ã–≤–æ–¥–∏—Ç —Å–æ–æ–±—â–µ–Ω–∏–µ –æ–± –æ—à–∏–±–∫–µ –ø—Ä–æ–≤–µ—Ä–∫–∏
                    }
                    break;
                case "2":
                    System.out.println("–í–≤–µ–¥–∏—Ç–µ –º–µ—Ç–æ–¥ –∑–∞–ø—Ä–æ—Å–∞: "); // –í—ã–≤–æ–¥–∏—Ç –ø—Ä–∏–≥–ª–∞—à–µ–Ω–∏–µ –≤–≤–æ–¥–∞ –º–µ—Ç–æ–¥–∞ –∑–∞–ø—Ä–æ—Å–∞
                    String methodName = sc.nextLine(); // –°—á–∏—Ç—ã–≤–∞–µ—Ç –º–µ—Ç–æ–¥ –∑–∞–ø—Ä–æ—Å–∞ —Å –∫–ª–∞–≤–∏–∞—Ç—É—Ä—ã
                    Method method = methods.get(methodName.toUpperCase()); // –ü–æ–ª—É—á–∞–µ—Ç –º–µ—Ç–æ–¥ –∑–∞–ø—Ä–æ—Å–∞ –∏–∑ —Ö–µ—à-—Ç–∞–±–ª–∏—Ü—ã
                    if (method == null) { // –ü—Ä–æ–≤–µ—Ä—è–µ—Ç, —Å—É—â–µ—Å—Ç–≤—É–µ—Ç –ª–∏ –º–µ—Ç–æ–¥ –∑–∞–ø—Ä–æ—Å–∞
                        System.out.println("–ù–µ–≤–µ—Ä–Ω—ã–π –º–µ—Ç–æ–¥ –∑–∞–ø—Ä–æ—Å–∞."); // –í—ã–≤–æ–¥–∏—Ç —Å–æ–æ–±—â–µ–Ω–∏–µ –æ–± –æ—à–∏–±–∫–µ
                    } else {
                        System.out.println("–ú–µ—Ç–æ–¥ " + method.getName() + ": " + method.getDescription()); // –í—ã–≤–æ–¥–∏—Ç –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏—é –æ –º–µ—Ç–æ–¥–µ –∑–∞–ø—Ä–æ—Å–∞
                    }
                    break;
                case "3":
                    System.out.println("–í–≤–µ–¥–∏—Ç–µ –∫–æ–¥ —Å–æ—Å—Ç–æ—è–Ω–∏—è: "); // –í—ã–≤–æ–¥–∏—Ç –ø—Ä–∏–≥–ª–∞—à–µ–Ω–∏–µ –≤–≤–æ–¥–∞ –∫–æ–¥–∞ —Å–æ—Å—Ç–æ—è–Ω–∏—è
                    int statusCode = sc.nextInt(); // –°—á–∏—Ç—ã–≤–∞–µ—Ç –∫–æ–¥ —Å–æ—Å—Ç–æ—è–Ω–∏—è —Å –∫–ª–∞–≤–∏–∞—Ç—É—Ä—ã
                    StatusCode status = statuses.get(statusCode); // –ü–æ–ª—É—á–∞–µ—Ç –∫–æ–¥ —Å–æ—Å—Ç–æ—è–Ω–∏—è –∏–∑ —Ö–µ—à-—Ç–∞–±–ª–∏—Ü—ã
                    if (status == null) { // –ü—Ä–æ–≤–µ—Ä—è–µ—Ç, —Å—É—â–µ—Å—Ç–≤—É–µ—Ç –ª–∏ –∫–æ–¥ —Å–æ—Å—Ç–æ—è–Ω–∏—è
                        System.out.println("–ù–µ–≤–µ—Ä–Ω—ã–π –∫–æ–¥ —Å–æ—Å—Ç–æ—è–Ω–∏—è."); // –í—ã–≤–æ–¥–∏—Ç —Å–æ–æ–±—â–µ–Ω–∏–µ –æ–± –æ—à–∏–±–∫–µ
                    } else {
                        System.out.println("–ö–æ–¥ —Å–æ—Å—Ç–æ—è–Ω–∏—è " + status.getCode() + ": " + status.getDescription()); // –í—ã–≤–æ–¥–∏—Ç –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏—é –æ –∫–æ–¥–µ —Å–æ—Å—Ç–æ—è–Ω–∏—è
                    }
                    break;
                case "0":
                    exit = true; // –£—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ—Ç exit –≤ true –¥–ª—è –≤—ã—Ö–æ–¥–∞ –∏–∑ —Ü–∏–∫–ª–∞
                    break;
                default:
                    System.out.println("–ù–µ–≤–µ—Ä–Ω—ã–π –≤—ã–±–æ—Ä. –ü–æ–∂–∞–ª—É–π—Å—Ç–∞, –≤—ã–±–µ—Ä–∏—Ç–µ —Å–Ω–æ–≤–∞."); // –í—ã–≤–æ–¥–∏—Ç —Å–æ–æ–±—â–µ–Ω–∏–µ –æ–± –æ—à–∏–±–∫–µ –≤—ã–±–æ—Ä–∞
            }
        }
    }

    class Method { // –û–±—ä—è–≤–ª—è–µ—Ç –≤–ª–æ–∂–µ–Ω–Ω—ã–π –∫–ª–∞—Å—Å Method
        private String name; // –û–±—ä—è–≤–ª—è–µ—Ç –ø–µ—Ä–µ–º–µ–Ω–Ω—É—é name –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –Ω–∞–∑–≤–∞–Ω–∏—è –º–µ—Ç–æ–¥–∞
        private String description; // –û–±—ä—è–≤–ª—è–µ—Ç –ø–µ—Ä–µ–º–µ–Ω–Ω—É—é description –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –æ–ø–∏—Å–∞–Ω–∏—è –º–µ—Ç–æ–¥–∞

        public Method(String name, String description) { // –û–±—ä—è–≤–ª—è–µ—Ç –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –∫–ª–∞—Å—Å–∞ Method
            this.name = name; // –£—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ—Ç –∑–Ω–∞—á–µ–Ω–∏–µ name
            this.description = description; // –£—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ—Ç –∑–Ω–∞—á–µ–Ω–∏–µ description
        }

        public String getName() { // –û–±—ä—è–≤–ª—è–µ—Ç –º–µ—Ç–æ–¥ –≥–µ—Ç –¥–ª—è name
            return name; // –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç –∑–Ω–∞—á–µ–Ω–∏–µ name
        }

        public String getDescription() { // –û–±—ä—è–≤–ª—è–µ—Ç –º–µ—Ç–æ–¥ –≥–µ—Ç –¥–ª—è description
            return description; // –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç –∑–Ω–∞—á–µ–Ω–∏–µ description
        }
    }

    class StatusCode { // –û–±—ä—è–≤–ª—è–µ—Ç –≤–ª–æ–∂–µ–Ω–Ω—ã–π –∫–ª–∞—Å—Å StatusCode
        private int code; // –û–±—ä—è–≤–ª—è–µ—Ç –ø–µ—Ä–µ–º–µ–Ω–Ω—É—é code –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –∫–æ–¥–∞ —Å–æ—Å—Ç–æ—è–Ω–∏—è
        private String description; // –û–±—ä—è–≤–ª—è–µ—Ç –ø–µ—Ä–µ–º–µ–Ω–Ω—É—é description –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –æ–ø–∏—Å–∞–Ω–∏—è –∫–æ–¥–∞ —Å–æ—Å—Ç–æ—è–Ω–∏—è

        public StatusCode(int code, String description) { // –û–±—ä—è–≤–ª—è–µ—Ç –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –∫–ª–∞—Å—Å–∞ StatusCode
            this.code = code; // –£—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ—Ç –∑–Ω–∞—á–µ–Ω–∏–µ code
            this.description = description; // –£—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ—Ç –∑–Ω–∞—á–µ–Ω–∏–µ description
        }

        public int getCode() { // –û–±—ä—è–≤–ª—è–µ—Ç –º–µ—Ç–æ–¥ –≥–µ—Ç –¥–ª—è code
            return code; // –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç –∑–Ω–∞—á–µ–Ω–∏–µ code
        }

        public String getDescription() { // –û–±—ä—è–≤–ª—è–µ—Ç –≥–µ—Ç—Ç–µ—Ä –¥–ª—è description
            return description; // –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç –∑–Ω–∞—á–µ–Ω–∏–µ description
        }
    }

    class Protocol { // –û–±—ä—è–≤–ª—è–µ—Ç –≤–ª–æ–∂–µ–Ω–Ω—ã–π –∫–ª–∞—Å—Å Protocol
        private int ip; // –û–±—ä—è–≤–ª—è–µ—Ç –ø–µ—Ä–µ–º–µ–Ω–Ω—É—é ip –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è IP-–∞–¥—Ä–µ—Å–∞
        private String description; // –û–±—ä—è–≤–ª—è–µ—Ç –ø–µ—Ä–µ–º–µ–Ω–Ω—É—é description –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –æ–ø–∏—Å–∞–Ω–∏—è –ø—Ä–æ—Ç–æ–∫–æ–ª–∞

        public Protocol(int ip, String description) { // –û–±—ä—è–≤–ª—è–µ—Ç –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –∫–ª–∞—Å—Å–∞ Protocol
            this.ip = ip; // –£—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ—Ç –∑–Ω–∞—á–µ–Ω–∏–µ ip
            this.description = description; // –£—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ—Ç –∑–Ω–∞—á–µ–Ω–∏–µ description
        }

        public int getIp() { // –û–±—ä—è–≤–ª—è–µ—Ç –º–µ—Ç–æ–¥ get –¥–ª—è ip
            return ip; // –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç –∑–Ω–∞—á–µ–Ω–∏–µ ip
        }

        public String getDescription() { // –û–±—ä—è–≤–ª—è–µ—Ç –º–µ—Ç–æ–¥ –≥–µ–¥ –¥–ª—è description
            return description; // –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç –∑–Ω–∞—á–µ–Ω–∏–µ description
        }
    }

    boolean validateIP(String ipAddress) { // –û–±—ä—è–≤–ª—è–µ—Ç –º–µ—Ç–æ–¥ validateIP –¥–ª—è –ø—Ä–æ–≤–µ—Ä–∫–∏ –∫–æ—Ä—Ä–µ–∫—Ç–Ω–æ—Å—Ç–∏ IP-–∞–¥—Ä–µ—Å–∞
        String[] parts = ipAddress.split("\\."); // –†–∞–∑–¥–µ–ª—è–µ—Ç IP-–∞–¥—Ä–µ—Å –Ω–∞ —á–∞—Å—Ç–∏
        if (parts.length != 4) { // –ü—Ä–æ–≤–µ—Ä—è–µ—Ç, —Å–æ—Å—Ç–æ–∏—Ç –ª–∏ IP-–∞–¥—Ä–µ—Å –∏–∑ 4 —á–∞—Å—Ç–µ–π
            return false; // –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç false, –µ—Å–ª–∏ IP-–∞–¥—Ä–µ—Å –Ω–µ —Å–æ—Å—Ç–æ–∏—Ç –∏–∑ 4 —á–∞—Å—Ç–µ–π
        }
        for (String part : parts) { // –ü–µ—Ä–µ–±–∏—Ä–∞–µ—Ç —á–∞—Å—Ç–∏ IP-–∞–¥—Ä–µ—Å–∞
            int number;
            try {
