public class Results {
    public static void main(String[] args) throws Exception {
        int year = parseInt(args[0]), start = parseInt(args[1]), end = parseInt(args[2]);
        final String LINK = "https://www.cjmranaghat.in/students/report-card-hidden.php?ses=4&stu=%03d-%d&case=scan";

        for (int id = start; id <= end; id++) {
            URL result = new URL(String.format(LINK, id, year));
            BufferedInputStream in = new BufferedInputStream(result.openStream());
            byte[] b = in.readAllBytes();
            in.close();

            String data = new String(b);
            data = data.substring(data.indexOf("NAME:"));
            String name = data.substring(data.indexOf(";\">") + 3, data.indexOf("</span")).strip().replace("  ", " ");
            data = data.substring(data.indexOf("CLASS:"));
            String class$ = data.substring(18, data.indexOf("</strong>"));
            data = data.substring(data.indexOf("SECTION:"));
            String section = data.substring(14, data.indexOf("</strong>"));
            data = data.substring(data.indexOf("NO:"));
            String roll = data.substring(15, data.indexOf("</strong>"));
            if (name.isEmpty() || class$.isEmpty() || section.isEmpty() || roll.isEmpty()) continue;

            data = data.substring(data.indexOf("REMARK:"));
            String remark = '[' + data.substring(31, data.indexOf(' ')).toLowerCase() + ']';
            if (remark.contains("conditional")) {
                remark = "[conditional]";
            } else if (remark.contains("promoted")) {
                remark = "[promoted]";
            } else if (remark.contains("detained")) {
                remark = "[detained]";
            } else {
                remark = "[]";
            }

            int idx = data.indexOf("Rank:");
            String rank;
            if (idx == -1) {
                rank = "";
            } else {
                data = data.substring(idx);
                rank = data.substring(29, data.indexOf("</strong>"));
            }

            data = data.substring(data.indexOf("Percentage"));
            double percentage;
            idx = data.indexOf("&nbsp;%</strong>");
            if (idx == -1) {
                percentage = 0;
            } else {
                percentage = parseDouble(data.substring(51, idx));
            }
            
            new File(String.format("files/%s-%s", class$, section).toLowerCase()).mkdirs();
            String filename = String.format("files/%s-%s/%2s (%5.2f%%) %2s %-30s (%03d-%d) %13s.html",
                                            class$, section, rank, percentage, roll,
                                            name.replace(" ", "-"), id, year, remark)
                                            .toLowerCase();
            BufferedOutputStream out = new BufferedOutputStream(new FileOutputStream(filename));
            out.write(b);
            out.close();
            System.out.printf("Saved %03d-%d -> %s (%s-%s-%s)%n", id, year, name, class$, section, roll);
        }
    }
}

