    public static BigInteger fastPow(BigInteger res, BigInteger n, BigInteger mod) {
        BigInteger ans = BigInteger.ONE;
        BigInteger two = new BigInteger("2");
        for (; !n.equals(BigInteger.ZERO); n = n.divide(two)) {
            if (n.mod(two).equals(BigInteger.ONE)) {
                ans = ans.multiply(res).mod(mod);
                ++cnt;
            }
            res = res.multiply(res).mod(mod);
            ++cnt;
        }
        return ans;
    }

    public static void main(String[] args) {
        BigInteger x = new BigInteger("53225659260379296181");
        BigInteger two = new BigInteger("2");
        System.out.println(fastPow(two, x.subtract(BigInteger.ONE), x));
        System.out.println(cnt);
    }
}
